function getTech(inputString) {
  // Replace underscores with spaces,
  return inputString.replace(/_/g, ' ')
    // Capitalize the first letter of each word
    .replace(/\b\w/g, function (match) {
      return match.toUpperCase();
    })
    .replace("PlusPlus", "++");
}

export function TechStackList({ techs }: { techs: TechStack[] }) {
  return (
    <div className="flex flex-wrap gap-4">
      {techs.map((t) => {
        const Icon = DevIcons[t]
        return (
          <div
            key={t}
            className="flex items-center justify-center gap-2 text-black dark:bg-white rounded-md border border-black dark:border-white p-1 px-2 font-bold text-sm md:text-base"
          >
            <div>
              <Icon />
            </div>
            <span>{getTech(t)}</span>
          </div>
        )
      })}
    </div>
  )
}
